                    <button type="submit" className="entry__button">{props.buttonName}</button>
                </form>
                <Routes>
                    <Route path="sign-up" element={<NavLink to="/sign-in" className="header__link">Войти</NavLink>} />
                </Routes>
            </PageWithForm>
        </>
    );
}
